import React, { useState, useEffect } from 'react';
import './App.css'; // Make sure this is here for styles

const initialData = [
  { id: 1, leak: 'Sensitive Data', level: 'High', date: '2025-04-16' },
  { id: 2, leak: 'Personal Data', level: 'Medium', date: '2025-04-14' },
  { id: 3, leak: 'Confidential Data', level: 'Low', date: '2025-04-10' }
];

function DataLeakageScript() {
  const [leaks, setLeaks] = useState([]);

  useEffect(() => {
    setLeaks(initialData);
  }, []);

  return (
    <div className="leak-container">
      <h2>Data Leakage Detection System</h2>
      <table>
        <thead>
          <tr>
            <th>Leak Type</th>
            <th>Severity Level</th>
            <th>Date of Breach</th>
          </tr>
        </thead>
        <tbody>
          {leaks.map((leak) => (
            <tr key={leak.id}>
              <td>{leak.leak}</td>
              <td>{leak.level}</td>
              <td>{leak.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <h1>Data Leakage Detection System</h1>
      <DataLeakageScript />
    </div>
  );
}

export default App;
